    G1 Y4.5 F5000
    G4 P500
    G1 Y8 F9000
    G1 Y4.3 F1500
    G4 P500
    G1 Y20 F9000
    G1 Y4.5 F5000
    G4 P500
    G1 Y8 F9000
    G1 Y4.3 F1500
    G4 P500
    G1 Y20 F9000
{endif}

MOVE_TO_TRASH

{if filament_type[current_extruder] == "PETG"}
SET_HEATER_TEMPERATURE HEATER=extruder TARGET=260 WAIT=1
{else}
SET_HEATER_TEMPERATURE HEATER=extruder TARGET={max(temperature[next_extruder], temperature[current_extruder])} WAIT=1
{endif}

M118 Unloading [current_extruder]
SYNC_EXTRUDER_MOTION EXTRUDER=slot[current_extruder] MOTION_QUEUE=extruder
